import Reat, { useState } from 'react';
import {Button, FormControl, Input, InputLabel} from '@mui/material/Button';
import './App.css';


function App() {
const [todos, setTodos] = useState(["wtf","i am fucking great coder","thinking of buying a laptop"])
const [input, setInput] = useState("");
console.log('#',input);

const addToDo = (event) => {
  event.preventDefault();
  setTodos([...todos, input]);
  setInput("");
}

  return (
    <div className="App">
     <h1>Hello World!</h1>
    <form>
    <input value={input} onChange={event => setInput(event.target.value)}/>
    <FormControl>
      <InputLabel>Write a ToDo</InputLabel>
    </FormControl>
    <Button disabled={!input} type="submit" onClick ={addToDo} variant="contained" color="success">
      Add Todo
    </Button>



    </form>
    <ul>
      {todos.map(todo => (
        <li>{todo}</li>
        ))}
    </ul>

    </div>
  )
}

export default App;
